import React from "react";

function Form() {
    return (
        <div className="form">
                <h1>Form</h1>
                <hr />
                <span >Country</span>
                <input type="text" placeholder="Enter your Country name" />
                <span >State</span>
                <input type="text" placeholder="Enter you State name" />
                <span >District</span>
                <input type="text" placeholder="Enter you District name" />
                <span >City/Village</span>
                <input type="text" placeholder="Enter you City/Village name" />
            
        </div>
    )
}
export default Form;
